k_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1024","type":"BoxAnnotation"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1308"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1310"},"nonselection_glyph":{"id":"1309"},"view":{"id":"1312"}},"id":"1311","type":"GlyphRenderer"},{"attributes":{},"id":"1127","type":"BasicTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"1110"},"glyph":{"id":"1132"},"group":null,"hover_g
